import React from "react";
import "./Services.css";

export default function Services() {
  return (
    <div className="wrapper">
      <span></span>
      <div className="services">
        <div className="s-1">SPA Development</div>
        <div className="s-2">Maintenance Support</div>
        <div className="s-3">API Integration</div>
      </div>
    </div>
  );
}
